import React, { useEffect } from "react";
import NavHeader from "../header/NavHeader";
import PickService from "./PickService";
import PickDoctor from "./PickDoctor";
import PickDateTime from "./PickDateTime";

const Book = () => {

    const [state, setState] = useEffect(null);

    useEffect(() => {
        if (sessionStorage.getItem("service") === null) {
            state = <PickService/>;
        }
        else if (sessionStorage.getItem("doctor") === null) {
            state = <PickDoctor/>
        }
        else if (sessionStorage.getItem("date") === null) {
            state = <PickDateTime/>
        }
    })

    return (
        <>
            {state}
        </>
    )
}

export default Book;
